import React from 'react';

import { v4 as uuidv4 } from 'uuid';
import {data} from './../data';

export default function About({ leng }) {
    return (
        <div className="about-container">
            {data[leng].about.map(item =>
                <p
                key = {uuidv4()}
                >{item}</p>)}

                <i className="fab fa-instagram"></i>
        </div>
    )
}
